import React from 'react';
import ReactDOM from 'react-dom';

import Beer from './beer';


export default class BeerList extends React.Component<{}, { beers:Array<Beer> }> {

    constructor(props:string[]) {
        // @ts-ignore
        super();
        props.push("corona");
        this.setState({beers:Array.from(props).map((s, i) => new Beer(s))});
    }

    render () {
        return (
            <div>
                {this.state.beers.map(b => b.render())}
            </div>
    );
    }
}
